import { Component } from '@angular/core';

@Component({
    selector: 'app-root',
    templateUrl: './app.component.html',
})
export class AppComponent {}

import { Component, Input } from '@angular/core';

@Component({
    selector: 'nwn-button',
    templateUrl: './button.component.html',
    styleUrls: ['./button.component.css'],
})
export class ButtonComponent {
    @Input()
    icon = 'angular';

    @Input()
    size: 'sm' | 'md' | 'lg' | 'xl' = 'xl';

    @Input()
    href = '';
}

styleUrlsData.data:
.btn {
    @apply px-6 py-3 flex space-x-2 items-center rounded-lg bg-green-100 hover:bg-green-600 text-green-800 hover:text-white font-semibold;
}

